import React from 'react';
import a from '../images/n3.jpg';

const Banner = () => {
    return (
      <div>
        <div
          className="w-full h-96 object-cover bg-"
          style={{ backgroundImage: `URL(${a})` }}
        >
          <h1 className="text-3xl text-white pt-36 pl-5 font-bold">Bright</h1>
          <div className="flex gap-5 pl-5 pt-3">
            <button className="btn bg-white px-7 text-black hover:bg-transparent">
              Play
            </button>
            <button className="btn bg-white px-7 text-black hover:bg-transparent">
              Mylist
            </button>
          </div>
          <p className="text-xs text-white  pl-5 font-bold pt-8">
            Angsty and awkward fifteen year old Ginny Miller often feels more
            mature than her thirty year old mother, the irresistible and dynamic
            Georgia Miller...
          </p>
        </div>
      </div>
    );
};

export default Banner;
